import React from "react";
import ReactDOM from "react-dom";

class FAQ extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: this.props.name,
      detail: this.detail.name,
    };
  }

  render() {
    const { name, detail } = this.state;
    return (
      <div className="col-12 border-bottom-1">
        <div>{name}</div>
        <div>{detail}</div>
      </div>
    );
  }
}
